import traceback
try:
	selectedColumn = self.props.selection.selectedColumn
	participantID = self.props.data.getValueAt(event.row,'participantId')
	isActive = self.props.data.getValueAt(event.row,'isActive')	
	if selectedColumn == "participantId": 
		#Display the detail screen
		tab_id = 60
		if isActive == 1:
			system.perspective.navigate("Participants/Detail/" + str(participantID) + "/" + str(tab_id))
	#elif selectedColumn == "Options":
	elif selectedColumn == "rowId":
		id = "PreviewParticipant" 
		params = {"participantID":participantID,'isActive':isActive}
		system.perspective.openDock(id=id,params=params)

	elif selectedColumn == "noteId": 
		#Display the case notes screen
		tab_id = 40
		if isActive == 1:
			system.perspective.navigate("Participants/Detail/" + str(participantID) + "/" + str(tab_id))
	else:
		pass

except:
	logger = system.util.getLogger("Participants Dashboard Participants_table OnRowClick")
	msg = traceback.format_exc()
	logger.error(msg)

